import logo from './logo.svg';
import './App.css';

function Square({ value }) {
    function handleClick() {
        if (value == null) {
            value = 'X';
        };
        console.log('clicked');
    }

    return <button className="square" onClick={handleClick}>{value}</button>;
}

function BoardRow() {
    return (
        <div className="borard-row">
            <Square />
            <Square />
            <Square />
        </div>
    );
}

export default function Board() {
    return (
        <>
            <BoardRow />
            <BoardRow />
            <BoardRow />
        </>
    );
}

